import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';
import Phones from './components/Phones';
class App extends Component {
constructor(props){
  super(props)
  this.state ={phones :[],filteredPhones:[],}
}
componentWillMount(){
  fetch("http://localhost:8000/phones").then(res => res.json())
  .then(data => this.setState({
    phones:data,
    filteredPhones: data
  }));
}

render (){
  return (
    <div className="container">
      <h1>GuideSmiths Phone Catalogue </h1>
      <hr/>
      <div className="row pt-3">
        <div className="col-md-6">

        <Phones phones={this.state.filteredPhones} handleAddCharacteristics={this.handleAddCharacteristics}/>
        </div>
        <div className="col-md-6">

        </div>
      </div>

    </div>
  );
}
}


export default App;
